import React, { useEffect, useState } from 'react';
import './Dashboard.css';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        const response = await axios.post('http://localhost:8002/api/users');
        setUsers(response.data.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchUsers();
  }, []);

  useEffect(() => {
    const deleteUser = async () => {
      try {
        const response = await axios.delete('http://localhost:8002/api/user_Delete');
        console.log(response.data);
        // Update users state after deletion if necessary
      } catch (error) {
        console.error('Error deleting user:', error);
      }
    };

    deleteUser();
  }, []);

  const handleStatus = async (data) => {
    const { email, is_active } = data;
    const requestedData = {
      email: email,
      is_active: is_active,
    };
    console.log(requestedData);
  };

  const handleDelete = async (data) => {
    const { email, is_deleted } = data;
    const requestedData = {
      email: email,
      is_deleted: is_deleted,
    };
    console.log(requestedData);
  };

  return (
    <div className="dashboard">
      <header className="header">
        <h1>Dashboard</h1>
      </header>
      <nav className="sidebar">
        {/* Sidebar content */}
      </nav>
      <main className="main-content">
        {/* Main content */}
      </main>
    </div>
  );
};

export default Dashboard;
